define({"topics" : [{"title":"Data Preview Overview","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#concept_jtn_s3m_lq","attributes": {"data-id":"concept_jtn_s3m_lq",},"menu": {"hasChildren":true,},"tocID":"concept_jtn_s3m_lq-d46e191043","next":"concept_jtn_s3m_lq-d46e191043",},{"title":"Data Collector UI - Preview Mode","shortdesc":"\n            <p class=\"shortdesc\">You can use <span class=\"ph\">Data Collector</span> to view how     data passes through the pipeline.\n            </p>\n         ","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#concept_l4q_pbl_sq","attributes": {"data-id":"concept_l4q_pbl_sq",},"menu": {"hasChildren":false,},"tocID":"concept_l4q_pbl_sq-d46e191259","topics":[]},{"title":"Preview Codes","shortdesc":"\n            <p class=\"shortdesc\">Data preview displays different colors for different types of data. Preview also uses   other codes and formatting to highlight\n               changed fields.\n            </p>\n         ","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#concept_qqc_s3h_tq","attributes": {"data-id":"concept_qqc_s3h_tq",},"menu": {"hasChildren":false,},"tocID":"concept_qqc_s3h_tq-d46e191338","topics":[]},{"title":"Previewing a Single Stage","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_cxd_p25_qq","attributes": {"data-id":"task_cxd_p25_qq",},"menu": {"hasChildren":false,},"tocID":"task_cxd_p25_qq-d46e191424","topics":[]},{"title":"Previewing Multiple Stages","shortdesc":"\n            <p class=\"shortdesc\">You can preview data for a group of linked stages within a pipeline.</p>\n         ","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_svd_dvz_sq","attributes": {"data-id":"task_svd_dvz_sq",},"menu": {"hasChildren":false,},"tocID":"task_svd_dvz_sq-d46e191517","topics":[]},{"title":"Editing Preview Data","shortdesc":"\n            <p class=\"shortdesc\">You can edit preview data to view how a stage or group of stages processes the         changed data. Edit preview data to\n               test for data conditions that might not appear in the         preview data set.\n            </p>\n         ","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_nyy_13l_5s","attributes": {"data-id":"task_nyy_13l_5s",},"menu": {"hasChildren":false,},"tocID":"task_nyy_13l_5s-d46e191623","topics":[]},{"title":"Editing Properties","shortdesc":"\n            <p class=\"shortdesc\">In data preview, you can edit stage properties to see how the changes affect preview         data. For example, you might\n               edit the expression in an Expression Evaluator to see how the         expression alters data. \n            </p>\n         ","href":"datacollector\/UserGuide\/Data_Preview\/DataPreview_Title.html#task_dyy_k3l_5s","attributes": {"data-id":"task_dyy_k3l_5s",},"menu": {"hasChildren":false,},"tocID":"task_dyy_k3l_5s-d46e191739","topics":[]}]});